def  imgtobase64(filename):
    with open(filename, 'rb') as f:
        base64_data = base64.b64encode(f.read())
        s = base64_data.decode()
        print('data:image/jpeg;base64,%s' % s)
def base64tobin(str):
    r = base64.b64decode(str)
    print(r)
    with open("d:/1/bin.bin", 'wb') as f:
        f.write(r)


